import p1 from '../../images/p1.png';
import p2 from '../../images/p2.png';
import visue from '../../images/visue.png';
import { Row, Col } from 'antd';

function Imgs(props) {
  return (
    <>
      <Row style={{ paddingTop: `166px` }}>
        <Col
          xs={{ span: 8, offset: 0 }}
          sm={{ span: 8, offset: 0 }}
          md={{ span: 10, offset: 0 }}
          lg={{ span: 5, offset: 5 }}
        >
          <div className="counters">
            <img src={p1} alt="img" style={{}}/>
          </div>
        </Col>

        <Col
          xs={{ span: 8, offset: 0 }}
          sm={{ span: 8, offset: 0 }}
          md={{ span: 10, offset: 0 }}
          lg={{ span: 5, offset: 0 }}
        >
          <div className="counters">
            <img src={p2} alt="img" />
          </div>
        </Col>

        <Col
          xs={{ span: 8, offset: 0 }}
          sm={{ span: 8, offset: 0 }}
          md={{ span: 10, offset: 0 }}
          lg={{ span: 5, offset: 0 }}
        >
          <div className="counters">
            <img src={visue} alt="img" />
          </div>
        </Col>
      </Row>
    </>
  );
}

export default Imgs;
